  const [characters, setCharacters] = useState([]);
   const onSearch = () =>{
     return (
      axios.get('https://rickandmortyapi.com/api/character')
      .then(response => {setCharacters([... characters])})
     )
   }
  return (
    <div className="App">
      <Nav onSearch={onSearch}/>
      <Cards characters={characters} />
    </div>
  );
}

export default App;
